import { StyleCardCreate } from "./styles";
import Input from "../input/index";

const CardCreate = ({ createHabit }) => {
  return (
    <StyleCardCreate>
      <Input label="Title" type="text"></Input>
      <Input label="Category" type="text"></Input>
      <Input label="Difficulty" type="text"></Input>
      <Input label="Frequency" type="text"></Input>
      <Input label="How much achieved" type="text"></Input>
    </StyleCardCreate>
  );
};

export default CardCreate;
